arguments.__populate_list_of_lists:
{%if vars.file_report.data.data%}
{%set incidents={}%}
{%if vars.file_report.data.data.incidents|length > 0%}
{%for entry in vars.file_report.data.data.incidents%}
{%set formatted_time = arrow.get(entry.firstSeen).to("UTC").format("HH:mm:ss.SSS DD-MM-YYYY")%}
{{incidents.update({formatted_time:entry.desc ~ ' - ' ~ entry.title})}}
{%endfor%}
{{vars.list_of_lists.append(['Incidents',incidents])}}
{%endif%}
{{vars.list_of_lists.append(['Sandbox Data',vars.file_report.data.data.analysis.scores.specs])}}
{{vars.list_of_lists.append(['Sandbox Data',vars.file_report.data.data.analysis.options])}}
{{vars.list_of_lists.append(['Verdict',vars.file_report.data.data.analysis.scores.verdict])}}
{%else%}
{{vars.list_of_lists.append(['Not Found',''])}}
{%endif%}
